<script>
// Bitwise order of operations (according to MDN)
// ~ << >> >>> & ^ |
// Subtraction (-) comes before all.
// Base for web function.
function decodeString(strData) {
    let specials = [
        0 // null
        , 10 // newline                
        , 13 // carriage return
        , 34 // double quote
        , 92 // backslash
    ];
    
    let decoded = [];
    let curByte = 0;
    let bitOfByte = 0;

    // TODO: compact and optimize this function.
    function push7(byte) {
        byte <<= 1;
        // Align this byte to offset for current byte.
        curByte = curByte | byte >>> bitOfByte;
        // Explanation:
        bitOfByte += 7;
        if (bitOfByte >= 8) {
            decoded.push(curByte);
            bitOfByte -= 8;
            // Now, take the remainder, left shift by what has been taken.
            curByte = byte << 7 - bitOfByte & 255;
        }
    }
    
    for (var i = 0; i < strData.length; i++) {
        let c = strData[i];
        let c2 = strData[i+1]; // returns undefined if out of range, ok

        // Check for a leading 1 bit, indicating a two-byte character.
        if (c >>> 7) {
            var specialIndex = c >>> 2 & 7; // 7 = 0b111. Note, >>> precedes &
            push7(specials[specialIndex]);
            if (~c & 2) push7(c << 6 & 64 | c2 & 63); // Note order of operations.
            i++;
        } else {
            // Regular ascii.
            push7(c);
        }
    }
    return decoded;
}

function decode(el) {
    let base123 = el.getAttribute('data-b123');
    dataAsByteArr = new TextEncoder().encode(base123);
    inflated = decodeString(dataAsByteArr);
    var blob = new Blob([inflated], {type: "image/png"});
    var url = URL.createObjectURL(blob);
    el.src = url;
}

decode(document.querySelectorAll('[data-b123]')[0]);
